Linea 77 is an Italian nu metal band formed in 1993. &quot;Inno All'Odio,&quot; a song from their fifth studio album, Available For Propaganda was featured on the soundtrack of FIFA 06. They are currently signed to Universal Records. In 2008 Linea 77 released a single entitled Sogni Risplendono featuring vocals from renowned Italian singer and songwriter Tiziano Ferro.

